import React, { Component } from 'react';
import Select from 'react-select';

const options = [
  { value: 'royalty', label: 'Royalty' },
  { value: 'netProfit', label: 'Net Profit' },
  { value: 'distributionPercent', label: 'Distribution (%)' },
  { value: 'distributionFee', label: 'Distribution (fee)' },
  { value: 'labelServices', label: 'Label Services' }
]

const DropTest = () => (
  <Select options={options} onClick={console.log()}/>
)

export default DropTest;

<Select
   className="label-single"
   classNamePrefix="Pick a Deal Type"
   defaultValue={colourOptions[0]}
   isDisabled={isDisabled}
   isLoading={isLoading}
   isClearable={isClearable}
   isRtl={isRtl}
   isSearchable={isSearchable}
   name="color"
   options={colourOptions}
 />
